import React from "react";
import Wrapper from "../helper/Wrapper";
import { Helmet } from "react-helmet";
const SearchPage = () => {
  return (
    <>
      <Helmet>
        <title>Màn Hình Ứng Dụng - GSTORE</title>
      </Helmet>
        <Wrapper title="Màn Hình">
      </Wrapper>
    </>
  );
};

export default SearchPage;
